  function Login () {
    const {loginWithRedirect} = useAuth0();
    return <button className="login-button" onClick={() => loginWithRedirect()}>Login</button>;
  }

  return(
    <div className="main">
      <div className="card">
        <h3>Welcome to robertoyoc.com</h3>
        <span className="subtitle-text">Please LogIn here:</span>
        <Login />
      </div>
    </div>
  );
}
